    "title": "Sample Metadata Guidelines",
    "content": "Sample Metadata Guidelines\n\nIntroduction\n\nThis document provides guidelines for annotating general sample metadata in SDRF-Proteomics format. These guidelines apply to samples from any organism (human, animal, plant).\n\nFor human-specific metadata (disease staging, comorbidities, treatment history), see Human Sample Metadata Guidelines.\n\nVersion 1.0.0 - 2025-01\n\nOrganism\n\nColumn: characteristics[organism]\n\nOntology: NCBI Taxonomy (NCBITaxon)\n\nUse the scientific name in lowercase. The validator will map to the correct ontology term.\n\nValue |NCBITaxon ID |Description\n\nhomo sapiens |NCBITaxon:9606 |Human\nmus musculus |NCBITaxon:10090 |Mouse\n\nOrganism Part / Tissue\n\nColumn: characteristics[organism part]\n\nOntology: UBERON for mammals/vertebrates, Plant Ontology (PO) for plants, FlyBase Anatomy (FBbt) for Drosophila.\n\nUse lowercase for all values. For cell line samples, use not applicable or specify the tissue of origin (e.g., cervix for HeLa).\n\nValue |UBERON ID |Description\n\nblood |UBERON:0000178 |Whole blood\nliver |UBERON:0002107 |Liver tissue\n\nAge\n\nColumn: characteristics[age]\n\nFormat: {Number}{Unit} where Unit is: Y (Years), M (Months), W (Weeks), D (Days).\n\nFor age ranges use: {LowerBound}{Unit}-{UpperBound}{Unit} (e.g., 40Y-50Y).\n\nUse not available when age is unknown, not applicable for immortalized cell lines.\n\nAge Description |SDRF Value\n\n40 years old |40Y\n8 weeks old |8W\n\nDevelopmental Stage\n\nColumn: characteristics[developmental stage]\n\nOntology: UBERON, EFO\n\nValue |Description\n\nadult |Sexually mature organism\nembryonic |Pre-birth/pre-hatching\n\nFor model organisms, use specific stages when applicable: embryonic day 14 (mouse E14), 24 hpf (zebrafish 24 hours post fertilization).\n\nDisease\n\nColumn: characteristics[disease]\n\nOntology: MONDO Disease Ontology (preferred), EFO, Human Disease Ontology (DOID)\n\nHealthy Samples: normal vs healthy vs control\n\nFor samples without disease, the terminology matters for standardization:\n\nnormal (PATO:0000461) - Recommended\n\n- S",
